		char packetType=a_socket[client].incomingBuffer[0];
		// log.show("<--- ");log.log(a_socket[client].incomingBuffer);log.cr();
		switch (packetType) {

		case '2'://registration
			a_socket[client].reset();
			RTMemoryUtil::memset(buffer, '\0', BUFF_LEN);
			sprintf(buffer, "0 0 0 RTAckSequence{distance 1,sockNo %d,hostNm\"%s\"}%c",
				LISTENING_PORT, SocketResourceConstants::MASTER_HOST.Contents, 0x03);
			size=strlen(buffer);
			// log.show("---> ");log.log(buffer);log.cr();
			if( a_socket[client].c_socket.write( buffer, size ) != size ) {
				//incomplete write socket probably closed, so lets clean up
				protocolhandler.deregistered().sendAt(client);
				closeConnection(client);
			}
			else {
				protocolhandler.registered().sendAt(client);
				messagesWereForwarded=1;
			}
			break;

		case '3'://deregistration
			a_socket[client].reset();
			protocolhandler.deregistered().sendAt(client);
			messagesWereForwarded=1;
			break;

		case '6'://message with data
		case '7'://message with pointer
			int tbd;
			char msgBuffer[BUFF_LEN];
			RTMemoryUtil::memset(msgBuffer, '\0', BUFF_LEN);

			if (sscanf(a_socket[client].incomingBuffer, "%d %d %d %s", &tbd, &tbd, &tbd, &msgBuffer) > 0) {
				if (protocolhandler.MESSAGE(RTString(msgBuffer)).sendAt(client)) {//send succeeds
					messagesWereForwarded=1;
				}
				else {//send failed, there is no client
					inUse[client]=0;
					closeConnection(client);
					protocolhandler.deregistered().sendAt(client);
				}
			}
			a_socket[client].reset();

			break;

		default:
			log.log("Couldn't decode message\n");
			break;

		}

	}
	else {
	if (!a_socket[client].connected &&
		a_socket[client].c_socket.hasData() &&
		a_socket[client].c_socket.state() == RTTcpSocket::Established) {
		// log.log("AAARRGGHH\n");
		closeConnection(client);
		protocolhandler.deregistered().sendAt(client);
		}
	}
}
